import ExpenseItem from './ExpenseItem'

function Expenses(props)
{

  
    return (
        <div style={{ 
          border: '1px solid #ccc', // Example border style
          padding: '10px',   
        
        }}>
          {props.items.map((expense) => (
            <ExpenseItem
              key={expense.id}
              title={expense.title}
              amount={expense.amount}
              date={expense.date}
              location={expense.location}
            />
          ))}
        </div>
      );
      

}
export default Expenses
